import React from "react";
import ReactPlayer from "react-player";

const Login = () => {


    const onChange = (e) => {
        console.log(e.target);
    }

  return (
    <div className='login_page'>
        <ReactPlayer 
          className="login_bgm"
          url={"https://youtu.be/pGbIOC83-So"}
          width="120%"
          height="100%"
          loop={true}
          playing={true}
          muted={true}
          controls={false}
        />
        <div className='login_box'>

            <input
            className="id_box"
            id="id"
            name="id"
            placeholder="아이디를 입력해주세요"
            onChange={onChange}
            ></input>

            <input
            className="ps_box"
            id="password"
            name="password"
            type="password"
            placeholder="비밀번호를 입력해주세요"
            onChange={onChange}
            ></input>
            <a href="#" className="login_wan_btn">Login</a>
            <p>비밀번호 찾기 / 아이디 찾기</p>

        </div> 
    </div>
  )
}

export default Login
